import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import HomePage from './Component/Home/HomePage';
import SignInPage from './Component/SingUp/SignInPage';
import { AuthProvider } from './Context/AuthProvider';
import EmployeeUpdate from './Component/Admin/EmployeeUpdate';
import EmployeeCreate from './Component/Admin/EmployeeCreate';
import EmployeeDelete from './Component/Admin/EmployeeDelete';
import ProtectedRoute from './ProtectedRoute/ProtectedRoute';

function App() {
  return (
    <AuthProvider>
      <Router>
        <Routes>
          <Route path="/" element={<HomePage />} />
          <Route path="/signin" element={<SignInPage />} />
          <Route path="/employeeupdate" element={<ProtectedRoute element={EmployeeUpdate} />} />
          <Route path="/employeecreate" element={<ProtectedRoute element={EmployeeCreate} />} />
          <Route path="/employeedelete" element={<ProtectedRoute element={EmployeeDelete} />} />
        </Routes>
      </Router>
    </AuthProvider>
  );
}

export default App;
